import { PROPERTY_TYPES } from '@babel/types';
import React from 'react';

const Popup = () => {
    return(
        <div className="popup-box">
            <div className="box">
                <span className="close-icon" onClick={props.handleClose}>X</span>
                {props.trip.description}
            </div>
        </div>
    )
}

export default Popup;
